import React from "react";
import { useNavigate } from 'react-router-dom';


class NavbarLogin extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            authenticated: false,
            registered:false,
            registerpage:false,
            loginpage:true,
            token: null,
            email: "",
            password: "",
            userign: "",
            userFirst: "",
            userLast: "",
            error: "",
        }
    }


    render() {
        let navigate = useNavigate();

        const toLogin = () => {
            let path = `login`;
            navigate(path);
        }
    
        let content = (
            <Button
            key="toLogin"
            onClick={() => toLogin()}
            sx={{ color: 'white', display: 'block', marginLeft: "auto" }}
        >
            Login
        </Button>
        )
        if (1==1) {
            content = <div>Working</div>
        }

        return(
            {content}
        )
    }
}
